import React from 'react'
import './Home.css'
import 'bootstrap/dist/css/bootstrap.css'

function Home () {
    return (
        <main class="border-0 d-flex flex-column">
            <button type="button" class="btn btn-primary">Fazer pedido</button>
            <button type="button" class="btn btn-primary">Falar com um consultor</button>
        </main>
    )
}

export default Home
